**Box Macro** displays a message in a styled box. [[Learn more>>http://extensions.xwiki.org/xwiki/bin/view/Extension/Box+Macro]]

There are several specialised box macros: 
* [[Info Macro>>http://extensions.xwiki.org/xwiki/bin/view/Extension/Info+Macro]]
* [[Success Macro>>http://extensions.xwiki.org/xwiki/bin/view/Extension/Success+Macro]]
* [[Warning Macro>>http://extensions.xwiki.org/xwiki/bin/view/Extension/Warning+Macro]]
* [[Error Macro>>http://extensions.xwiki.org/xwiki/bin/view/Extension/Error+Macro]]

== Box Macro ==

{{example}}
{{box title="Title of the box" width="30%"}}
This is a box message
{{/box}}
{{/example}}

== Info Macro ==

{{example}}
{{info}}
This is an informative message
{{/info}}
{{/example}}

== Success Macro ==

{{example}}
{{success}}
This is a success message
{{/success}}
{{/example}}

== Warning Macro ==

{{example}}
{{warning}}
This is a warning message
{{/warning}}
{{/example}}

== Error Macro ==

{{example}}
{{error}}
This is an error message
{{/error}}
{{/example}}
